import React, { Component } from "react";
import { getService } from "../common/fakeServices";

class Services extends Component {
  state = { service: getService() };
  handleClick = (propss) => {
    const service = { ...propss };
    console.log(service.service.name);
  };
  render() {
    const { service } = this.state;
    return (
      <div className="row">
        {service.map((service) => (
          <div className="col-sm-3" key={service._id}>
            <div
              className="card text-center active m-2"
              style={{ cursor: "pointer" }}
              href="#"
              onClick={() => this.handleClick({ service })}
            >
              <div className="card-body">
                <h5 className="card-title">{service.name}</h5>
                <p className="card-text">Time: {service.time}</p>
              </div>
            </div>
          </div>
        ))}
      </div>
    );
  }
}

export default Services;
